const MoviePoster = ({ results }) => {
     
    const renderMovieList = () => {
        results.map((result) => {
            return (
                <div className='card row'>
                    <img className='card-img-top img-fluid' src={result.Poster} alt='card-image' />
                </div>
//                 <div class="card" style="width: 18rem;">
